// Imports 
    // Librarys
import React, { useState } from "react";
import objects from "../jsons/objects.json"
import list from "../jsons/list.json";
    // Components
import {Footer} from "../components/Footer";
import {Header} from "../components/Header";
import {Category} from "../components/Category";
import {Searcher} from "../components/Searcher";
import {Card} from "../components/Card";
    // Styles
import './styles/homeStyle.css'
import axios from "axios";

// Component
const Home = () => {

    const [list, setList] = useState([]);

    axios.get("http://localhost:8080/productos")
    .then( res => console.log(res))

    return(
        <div className = "App">
            <Header />
                <main>
                    <Searcher />
                    <div className='categories'>
                        <h2>Buscar por tipo de alojamiento</h2>
                        <div className='categories_contianer'>
                            {objects.map((object) => (
                            <Category key={object.id} object={object}/>
                            ))}
                        </div>
                    </div>
                    <div className="recomendations">
                        <h2 className = "recomendationsH2">Recomendaciones</h2>
                        <div className='recomendations_container'>
                        {list.map((object) => (
                            <Card key={object.id} object={object}/>
                        ))}
                        </div>
                    </div>
                </main>
            <Footer />
        </div>
    );
}

// Exports
export {Home};
